import React from "react";
import { useState } from "react";
import "./index.css"



const App = () =>{
    const [Count, setCount] = useState(50)

const incNum = () =>{
    setCount(100)
}
    return(
    <>
    <div className="heading">
    <h1>{Count}</h1>
    <button onClick={incNum}>Click Me</button>
    </div>
    </>
    )
}
export default App;
